Don't be afraid to type. Your variable name can be 100 characters long, as long as it explains what it does it's fine. Don't hardcode values. Even if it shouldn't appear in the inspector declare it in a variable. // Do this
private const _thisVariablesDoesThis = 5; //Unmodifiable private Function()
{ // Here we know what both variables are. thisVariableDoesSomething += thisVariablesDoesThis; }
// Don't do this
private Function()
{ thisVariableDoesSomething += 5; // Why are we increasing it by 5?
} Don't add stuff about petting jellies in the Jelly_Bath script. Scripts that carry more than one functionality are confusing and prone to breaking. Make it good, not perfect. Perfect code does not exist.

