Use camelCase to name variables. Private variables should start with an underscore(_). If your variable is a boolean the name should be asking a question. Avoid special characters, it can affect how the editor reads the names. // Do this
private int _healthPoints;
private bool _hasItem; //Don't do this:
private int PlayerChar;
private bool A;
private string PSText;

