Try to keep your variables as private as possible. That way we have better control of when and how scripts alter them. There is no harm in accessing a variable from another class. Be more concerned about changing the value from another class. Examples Click Here // Do this
private int _variable; // safest approach
[Serialized Field] private int _variable; // Can be altered in the inspector //working with properties (getters and setters) private int _variable;
public int Variable { get {return _variable;} // can be read from anywhere private set {_variable=value;} // set from this class only
} [field:SerializeField] public float MyFloat3 { get; private set; } // same as above, but Unity creates a backupfield so you can set it in the inspector

