Right below the using statements on the script add the below XML tag: /// <summary>
/// Code explanation here
/// </summary> The explanation should follow these rule: Use it to explain WHAT the code does, what purpose the code fulfills. Make the explanation short, no more than 5 lines. Saying that the Jelly_sleep.cs "Handles the Jelly's sleep" is not an explanation. A good explanation should contain where this script should be attached or when it's functions are called.
